import React, { Component } from "react";
import IconButton from "@material-ui/core/IconButton";
import { withRouter } from "react-router";
import "./SignUp.css";

class SignUpForm extends Component {
    constructor(props) {
        super(props);
    }
    homePage = (event) =>{
        this.props.history.push({
            pathname: "/"
          });
    }
  render() {
    return(
      <div className = "abc">
      <form>

            <h3>Name</h3>
            <input
              className="text"
              name="name"
              type="text"
              placeholder="Enter The Valid Name"
            />
            <h3>Last Name</h3>
            <input
              className="text"
              name="lastName"
              type="text"
              placeholder="Enter The Valid Last Name"
            />
            <h3>Email Id</h3>
            <input
              className="text"
              name="email"
              type="text"
              placeholder="Enter The Valid Email"
            />
            <h3>Password</h3>
            <input
              className="text"
              name="password"
              type="text"
              placeholder="Enter The Password"
            />
            <h3>Contact</h3>
            <input
              className="text"
              name="Contact"
              type="text"
              placeholder="Enter The Valid Contact"
            />
            </form>
             <div className="Sign_up">
            <IconButton style={{ color: "Black",size : "40%" }} >Sign Up</IconButton>
          </div>
          <button className = "backToLogin"
          onClick = {this.homePage}>Click To Login</button>


          </div>


    )
  }
}
export default SignUpForm;
